import React from "react";
import { Link, NavLink } from "react-router-dom";

function Genere() {
  return (
    <div>
      <ul className="nav genere-list">
        <li>
          <NavLink to="/home">Home</NavLink>
        </li>
        <li>
          <NavLink to="/home/comedy">comedy</NavLink>
        </li>
        <li>
          <NavLink to="/home/horror">Horro</NavLink>
        </li>
        <li>
          <NavLink to="/home/romance">Romance</NavLink>
        </li>
      </ul>
    </div>
  );
}

export default Genere;
